import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on "Your Profile" link using text content
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Wait for profile page to load and verify by checking for profile elements
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const nameEl = document.querySelector('.profile-info h2');
      const usernameEl = document.querySelector('.username');
      const bioEl = document.querySelector('.bio');

      return {
        fullName: nameEl?.textContent || '',
        username: usernameEl?.textContent || '',
        bio: bioEl?.textContent || ''
      };
    });

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    return {
      success: true,
      action: "Navigated to Jun's Profile and extracted profile information",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
